                    month[7] = "August";
                    month[8] = "September";
                    month[9] = "October";
                    month[10] = "November";
                    month[11] = "December";
                    var dateUtc1 = month[parseInt(res11[1])] + " " + res11[2] + " " + res11[0] + " " + resB2;
